        super(props);
        this.state = {
            isLoading: true,
            userReports: [],
            store: this.props.store
        }
    }

    componentDidMount() {

    }

    renderNavigation() {
      return (
        <Navbar bg="dark" variant="dark">
          <Navbar.Brand href="#home">
            <img
              alt=""
              src="./static/logo.png"
              width="30"
              height="30"
              className="d-inline-block align-top"
            />{' '}
            React Bootstrap
          </Navbar.Brand>
        </Navbar>


      );

    }

    render() {
        return (
          <div>
            {this.renderNavigation()}
          </div>


        );
    }
}

export default App;
